import{_ as l,J as i,j as c,b as h,ak as u,L as o,v as n,e,q as t}from"./chunks/framework.XZaavUCS.js";const T=JSON.parse('{"title":"General","description":"Frequently Asked Questions","frontmatter":{"title":"General","description":"Frequently Asked Questions","footer":false},"headers":[],"relativePath":"manuals/faq/general/index.md","filePath":"manuals/faq/general/index.md","lastUpdated":1770060232000,"breadcrumbs":[{"text":"Back to Home","link":"/"}]}'),p={name:"manuals/faq/general/index.md"};function d(m,a,y,f,g,b){const r=i("PluginTabsTab"),s=i("PluginTabs");return c(),h("div",null,[a[2]||(a[2]=u('<h1 id="general" tabindex="-1">General <a class="header-anchor" href="#general" aria-label="Permalink to &quot;General&quot;">​</a></h1><p>Frequently Asked Questions</p><h2 id="what-is-trinity-launcher" tabindex="-1">What is Trinity Launcher? <a class="header-anchor" href="#what-is-trinity-launcher" aria-label="Permalink to &quot;What is Trinity Launcher?&quot;">​</a></h2><p>Trinity Launcher is an open-source <strong>Cross-Platform</strong> launcher that lets you manage your games and projects - faster and easier than ever.</p><div class="tip custom-block"><p class="custom-block-title">Disclaimer</p><p>Trinity Launcher is not hosting any content, we are not affilated with or responsible for any source that is: slow, down, missing chapters, or has supbar image quality.</p></div><h2 id="where-do-i-post-app-issues" tabindex="-1">Where do i post app issues, bugs or feature requests? <a class="header-anchor" href="#where-do-i-post-app-issues" aria-label="Permalink to &quot;Where do i post app issues, bugs or feature requests?&quot;">​</a></h2><p>To post app issues, bugs, and feature requests please open a ticket on GitHub by following the link [here](<a href="https://github.com/TrinityLauncherApp/Trinity" target="_blank" rel="noreferrer">https://github.com/TrinityLauncherApp/Trinity</a> Launcher/issues/new/choose)</p><h2 id="why-isnt-trinity-launcher" tabindex="-1">Why isn&#39;t Trinity Launcher on the Google Play Store? <a class="header-anchor" href="#why-isnt-trinity-launcher" aria-label="Permalink to &quot;Why isn&#39;t Trinity Launcher on the Google Play Store?&quot;">​</a></h2><p><strong>Trinity Launcher</strong> won&#39;t be on the <strong>Google Play Store</strong>. <strong>Google</strong> might take down the app due to certain content, which the developers wishes to avoid.</p><p>To report <strong>Trinity Launcher</strong> copycats on the <strong>Google Play Store</strong>, fill out <a href="https://support.google.com/googleplay/android-developer/contact/takedown" target="_blank" rel="noreferrer">this form</a> following the steps below.</p><details class="details custom-block"><summary>Steps to report Trinity Launcher copycats</summary><ol><li><p>Go to the page -&gt; three dots menu -&gt; Flag as inappropriate -&gt; Other objection.</p></li><li><p>After choosing &quot;Other objection&quot;, you may choose to put down any or all of the following:</p><p>The app infringes on the Google Play Developer Policy by</p><p>Encouraging Infringement of Copyright</p><blockquote><p>We don’t allow apps that induce or encourage copyright infringement. Before you publish your app, look for ways your app may be encouraging copyright infringement and get legal advice if necessary.</p></blockquote><p>Trademark Infringement</p><blockquote><p>We don’t allow apps that infringe on others’ trademarks. A trademark is a word, symbol, or combination that identifies the source of a good or service. Once acquired, a trademark gives the owner exclusive rights to the trademark usage with respect to certain goods or services.</p><p>Trademark infringement is an improper or unauthorized use of an identical or similar trademark in a way that is likely to cause confusion as to the source of that product. If your app uses another party’s trademarks in a way that is likely to cause confusion, your app may be suspended.</p></blockquote><p>Misleading Claims, e.g. &quot;Minecraft BedrockTop - Best Minecraft Bedrock Reader&quot;</p><blockquote><p>We don’t allow apps that contain false or misleading information or claims, including in the description, title, icon, and screenshots. Here are some examples of common violations: Apps that misrepresent or do not accurately and clearly describe their functionality:</p><ul><li>Developer or app names that misrepresent their current status or performance on Play. (E.g. “Editor’s Choice,” “Number 1 App,” “Top Paid”)...</li><li>Apps that are improperly categorized.</li></ul></blockquote></li></ol></details><h2 id="is-trinity-launcher-available" tabindex="-1">Is Trinity Launcher available for iOS/iPadOS? <a class="header-anchor" href="#is-trinity-launcher-available" aria-label="Permalink to &quot;Is Trinity Launcher available for iOS/iPadOS?&quot;">​</a></h2><p>There is no iOS or iPadOS version and neither are there plans for one. Porting is difficult due to the separate codebases of iOS and Android apps.</p><p>Any app proclaiming to be &quot;<strong>Trinity Launcher for iOS</strong>&quot; is not by us and should be treated as a scam.</p><h2 id="can-i-read-light-novels" tabindex="-1">Can I read light novels? <a class="header-anchor" href="#can-i-read-light-novels" aria-label="Permalink to &quot;Can I read light novels?&quot;">​</a></h2><p><strong>Trinity Launcher</strong> can&#39;t read light novels; it&#39;s an image parser, not a text parser.</p><h2 id="can-i-stream-anime" tabindex="-1">Can I stream anime? <a class="header-anchor" href="#can-i-stream-anime" aria-label="Permalink to &quot;Can I stream anime?&quot;">​</a></h2><p><strong>Trinity Launcher</strong> isn&#39;t designed for anime streaming.</p><p>Projects using the <strong>Trinity Launcher</strong> name for anime streaming aren&#39;t affiliated with the main project.</p><h2 id="can-i-use-trinity-launcher" tabindex="-1">Can I use Trinity Launcher on desktop? <a class="header-anchor" href="#can-i-use-trinity-launcher" aria-label="Permalink to &quot;Can I use Trinity Launcher on desktop?&quot;">​</a></h2><p>No, you can&#39;t.</p><div class="tip custom-block"><p class="custom-block-title">Note</p><p>We provide cross-platform support for Windows, Mac and Linux.</p></div><h2 id="can-trinity-launcher-sync" tabindex="-1">Can Trinity Launcher sync across devices? <a class="header-anchor" href="#can-trinity-launcher-sync" aria-label="Permalink to &quot;Can Trinity Launcher sync across devices?&quot;">​</a></h2><p>Yes, the application supports synchronization between devices.</p><p>Learn how to create a Trinity Launcher Sync account <a href="/guides/synchronization/">here</a></p><h2 id="what-do-i-do-if-i-have-to" tabindex="-1">What do I do if I have to switch to a new phone? <a class="header-anchor" href="#what-do-i-do-if-i-have-to" aria-label="Permalink to &quot;What do I do if I have to switch to a new phone?&quot;">​</a></h2><p>Please follow these steps:</p><ol><li>Backup your entire favourites and history from your old device and transfer it to your new phone.</li><li>Restore the backup.</li></ol><div class="tip custom-block"><p class="custom-block-title">Note</p><p>More information about backup and restore is listed <a href="/guides/backups/">here</a>.</p></div><h2 id="can-i-restore-my-tachiyomimihon" tabindex="-1">Can I restore my Tachiyomi/Mihon backup to Trinity Launcher? <a class="header-anchor" href="#can-i-restore-my-tachiyomimihon" aria-label="Permalink to &quot;Can I restore my Tachiyomi/Mihon backup to Trinity Launcher?&quot;">​</a></h2><p>No, you can&#39;t. This is due to the difficulty in supporting and adapting the <code>.proto.gz</code> or <code>.tachibk</code> format that <strong>Tachiyomi/Mihon</strong> uses. Also <strong>Trinity Launcher</strong> and <strong>Tachiyomi</strong> and its forks have different data structures that they use. For <strong>Neko for Minecraft BedrockDex</strong> users, we recommend to use <a href="https://github.com/PhantomShift/nekotatsu" target="_blank" rel="noreferrer">Nekotatsu</a> if you&#39;re on the desktop or <a href="https://github.com/PhantomShift/nekotatsu-mobile" target="_blank" rel="noreferrer">Nekotatsu Mobile</a> for android devices.</p>',31)),o(s,null,{default:n(()=>[o(r,{label:"Nekotatsu"},{default:n(()=>[...a[0]||(a[0]=[e("div",{class:"tip custom-block"},[e("p",{class:"custom-block-title"},"How to use"),e("p",null,"The instructions are based from the project's README.")],-1),e("ol",null,[e("li",null,[t("It is recommended to run the update command first to fetch some necessary files. "),e("code",null,"$ nekotatsu update")]),e("li",null,[t("Then, you can run the conversion command like so: "),e("code",null,"$ nekotatsu convert (neko.tachibk)")])],-1)])]),_:1}),o(r,{label:"Nekotatsu Mobile"},{default:n(()=>[...a[1]||(a[1]=[e("ol",null,[e("li",null,[t("Tap the ⚙️ icon on the top left and tap "),e("code",null,"Download"),t(".")]),e("li",null,[t("Next, you'll need to tap "),e("code",null,"Download"),t(" button on the right for each item (Tachiyomi Sources, Trinity Launcher Parsers, Fixer Script) and make sure they have a green checkmark on the left.")]),e("li",null,[t("Tap the ⚙️ icon again on the top left and tap "),e("code",null,"Convert"),t(".")]),e("li",null,[t("To get started, tap the "),e("code",null,"Pick Backup"),t(" button and pick the "),e("code",null,".tachibk"),t(" file you'll want to convert. Next, tap the "),e("code",null,"Pick Save Path"),t(" button and select the path you'll want to save your converted backup onto.")]),e("li",null,[t("Finally, tap the "),e("code",null,"Convert"),t(" button. If it says "),e("code",null,"Conversion completed!"),t(", that means the file is converted successfully.")])],-1)])]),_:1})]),_:1})])}const v=l(p,[["render",d]]);export{T as __pageData,v as default};
